BlocklyGamesMsg["Pond.scanTooltip"] = "শত্রুদের দেখুন। গতিপথ নির্দেশিত করুন(০থেকে৩৬০)। গতিপথে সবথেকে কাছের শত্রুর দূরত্ব দেখাবে। অন্তহীন দূরত্ব দেখাবে যদি শত্রু না থাকে।";
