BlocklyGamesMsg["Pond.helpUseScan"] = "অাপনার সমাধান কাজ করে, কিন্তু অাপনি অারো ভাল করতে পারেন। 'scan' ব্যবহার করুন কামানকে জানাতে যে কতদূরে শুট করতে হবে।";
BlocklyGamesMsg["Pond.helpText1"] = "'cannon' কমান্ড ব্যবহার করুন লক্ষে অাঘাত হানতে। প্রথমে বিবেচনা করুন এ্যাঙ্গেল, দ্বিতীয়ত দূরত্ব। দু'টির সঠিক সমন্বয় বের করুন।";
BlocklyGamesMsg["Pond.helpText2"] = "এই লক্ষবস্তুতে অনেকবার অাঘাত করা দরকার। একটি 'while(true)' লুপ ব্যবহার করুন অনির্দিষ্ট ভাবে কিছু করতে।";
BlocklyGamesMsg["Pond.helpText3a"] = "প্রতিপক্ষ সামনে অাবার পিছনে যায়, অাঘাত করা কঠিন। 'scan' নির্দেশিত দিকে প্রতিপক্ষের সঠিক দুরত্বে নিয়ে যায়।";
BlocklyGamesMsg["Pond.helpText3b"] = "এটা একেবারে সেই দুরত্ব যা 'কামান' কমান্ডের প্রয়োজন সঠিকভাবে অাঘাত হানতে।";
BlocklyGamesMsg["Pond.helpText4"] = "প্রতিপক্ষ এত দূরে যে তা কামানের অাঘাত সীমার বাহিরে (যার সীমা ৭০ মিটার পর্যন্ত)। বিকল্প হিসাবে, 'সাঁতার' কমান্ড ব্যবহার করুন, প্রতিপক্ষের দিকে সাঁতার শুরু করতে আর তা ধ্বংস করতে।";
BlocklyGamesMsg["Pond.helpText5"] = "কামান ব্যবহারের জন্য এই পতিপক্ষ অনেক দূরে। কিন্তু অাপনি এত দুর্বল যে সংঘাতে টিকে থাকার মত নয়। ভুমি বরাবর অাপনার অবস্থান ৫০ এর নিচে গেলে অাপনি প্রতিপক্ষ বরাবর সাঁতার কাটেন। তারপর 'থামুন' এবং কামান ব্যবহার করুন।";
BlocklyGamesMsg["Pond.helpText6"] = "এই প্রতিপক্ষ অন্যত্র সরে যাবে যখন এটি অাঘাত পাবে। যদি তা অাঘাত সীমার (৭০মিটার) বাহিরে চলে যায় তবে তার দিকে সাঁতার কাটুন।";
